INSERT INTO `tblfaq` (`qno`, `question`, `answer`) VALUES
(1, 'How many hostels do VGI Hostel have?', 'The Institution has two  “In Campus Boy’s Hostels” and one “In Campus Girls Hostel” .'),
(2, 'What is the process of allotment of seat?', 'Allotment is on the first cum first serve basis, usually, when the number of applicants are more than the number of hostel seats, a waiting list is drawn up and allocation is as per the list and availability arising.'),
(3, ' Do you engage the hostellers in other activities also?', ' To provide a healthy competitive and diverse cultural learning environment ,there are committees for cultural and sports activities. Meetsare organized alongside other special occasions regularly. Hostels organizes almost all festivals celebrated across '),
(4, ' What type of basic infrastructure has been provided to the hostellers?', 'A basic bed, study table, chair and cupboard is assured to every boarder with air conditioning / Non A Calongside attached bath / Common facility as opted for.'),
(5, ' If some hosteller falls sick or gets injured, what actions are taken by the administration ?', 'We have First Aid Medical Kit available in each hostel. We also run OPD  between Monday – Saturday  during day time and a Medical practitioner is available to provide free of cost consultation to the hostellers\r\n\r\nWe have a 24*7 facility of ambulance to t'),
(6, 'What about ragging?', 'VGI Hostel is a  ragging free zone  in  hostels as well as in Campus. The different committees have been formulated for this purpose. The University has zero tolerance policy strictly in compliance with Honorable Supreme Court /Gov. of India /UGC/ AICTE/ '),
(7, 'What about the security of our students who are in the hostel?', 'Security Guard: The entire campus is highly secured, so are the hostels. Nobody can enter the hostel without permission as we have deputed 24*7 professional security guards to avoid any untoward incidence.  \r\n\r\nElectronic Surveillance: The entire campus i');
